<!-- tooltip end -->
<p>철회된 버전에 관한 자세한 정보는 <a href="https://go.dev/ref/mod#go-mod-file-retract">go.dev의 <code>retract</code> directive</a>(retract 지시문)를 참조하세요.<br/>최신 버전에 관한 데이터는 명령어 <a href="https://go.dev/ref/mod#go-list-m">go list -m -u</a>로 얻을 수 있습니다.
</p>
